function App() {
  return (
    <React.Fragment>
      <BrowserRouter>
        <Nav />
        <Route exact path='/' component={<Bienvenido/>} />
        {/* <Route exact path='/countries' component={<Home/>} />
        <Route exact path='/countries/:id' component={<Card/>} />
        <Route exact path='/activity' component={<AddActivity/>} />       */}
      </BrowserRouter>
    </React.Fragment>

  );
}


export default App;
